import "./index.css";
import { changeSession ,changeBreak } from "../actions/index";
import { useSelector, useDispatch } from "react-redux";

export default function Setting() {
    let dispatch = useDispatch();
    return (
        <div className="setting">
            <div>
                <div id="session-label">Session Length</div>
                <div>
                    <button id="session-decrement" onclick={() => {
                        dispatch(changeSession("decrement"))
                    }}>-</button>
                    <h3 id="session-length">25</h3>
                    <button id="session-increment" onclick={() => {
                        dispatch(changeSession("increment"))
                    }}>+</button>
                </div>
            </div>
            <div>
                <div id="break-label">Break Length</div>
                <div>
                    <button id="break-decrement" onclick={() => {
                        dispatch(changeBreak("decrement"))
                    }}>-</button>
                    <h3 id="break-length">5</h3>
                    <button id="break-increment" onclick={() => {
                        dispatch(changeBreak("increment"))
                    }}>+</button>
                </div>
            </div>
        </div>
    );
}
